import React from 'react'
import './statics/styles/BlockBtn.scss'

function BlockBtn ({ Icon, Title, onClick }) {
    return (
        <div className='BlockBtn' onClick={onClick()}>
            <Icon style={{ color: 'white' }}/>
            <p>{Title}</p>
        </div>
    )
}

export default BlockBtn
